import React from "react";
import TakeMeHome from "../TakeMeHome";
import { useMediaQuery } from 'react-responsive'

const SoftwareEngineer = () => {
    const isDesktopOrLaptop = useMediaQuery({
        query: '(min-width: 1224px)'
    })
    const isTabletOrMobile = useMediaQuery({ query: '(max-width: 1224px)' })

    return (
        <div className={`swe-page-font ${isTabletOrMobile ? 'p-4' : 'p-8'}`}>
            <TakeMeHome />
            <div className={`text-3xl font-medium text-center ${isTabletOrMobile ? 'text-2xl' : 'text-4xl'}`}>Software Engineer</div>
            <p className={`text-center ${isTabletOrMobile ? 'text-base' : 'text-lg'}`}>
                I am a software engineer with a passion for building scalable and
                maintainable software. I have experience in a variety of languages
                and technologies, but I am most comfortable with JavaScript and
                Python. I am currently working as a software engineer at
                <a href="https://www.uber.com" className="text-blue-500">Uber</a> in San Francisco.
            </p>
        </div>
    );
};

export default SoftwareEngineer;
